import React from 'react';
import UdeA from 'components/images/udea.png';

function Workexperience() {
  return (
    <div>
      <h1 className='text-black text-center text-4xl font-bold mt-6'>
        Work Experience
      </h1>
      <div className='flex flex-row information-image-right '>
        <div>
          <h1 className='text-black text-lg font-mono'>Teacher Assistant</h1>
          <h1 className='text-black text-lg font-mono '>
            University of Antioquia
          </h1>
          <h1 className='text-black text-lg font-mono'>
            June 2019 - Currently
          </h1>
          <img
            className='scale-50 object-center m-auto '
            src={UdeA}
            alt='Logo'
          />
        </div>
      </div>
    </div>
  );
}

export { Workexperience };
